/*!

=========================================================
* Light Bootstrap Dashboard React - v1.3.0
=========================================================

* Product Page: https://www.creative-tim.com/product/light-bootstrap-dashboard-react
* Copyright 2019 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/light-bootstrap-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React, { Component, useState } from "react";
import { Navbar, NavDropdown, Nav } from "react-bootstrap";
import DatePicker from 'react-datepicker';
import moment from 'moment';

class AdminNavbar extends Component {
constructor(props)
{
  super(props);
  this.state = {
    endDate :  new Date(),
    startDate : new Date()
  }
}
  render() {
    return (
<Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Navbar.Brand href="#home">Fitbit Test Client</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <NavDropdown title="Select Food Filters" id="collasible-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
      <Nav.Link eventKey={2} href="#memes">
         <DatePicker selected={this.state.startDate} onChange={(date) => this.setState({ startDate: date })}name="startDate"
              dateFormat="MM/dd/yyyy"/>
      </Nav.Link>
      <Nav.Link eventKey={2} href="#memes"> <DatePicker selected={this.state.endDate} onChange={(date) => this.setState({ endDate: date })} name="endDate"
              dateFormat="MM/dd/yyyy"/>
      </Nav.Link>
    </Nav>
    <Nav>
      <Nav.Link eventKey={2} href="#memes">
        Welcome, Colin Myers
      </Nav.Link>
      <Nav.Link eventKey={2} href="#memes">
        Log out
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
    );
  }
}

export default AdminNavbar;
